import GlobalStyles from '../src/styles/GlobalStyles';
import Head from 'next/head';

import "../config/i18n";
import "isomorphic-fetch";

export default function MyApp({ Component, pageProps }) {
  return (
  <>
    <GlobalStyles/>
    <Head>
        <meta charset="utf-8" />
        <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
        <meta name="viewport" content="width=device-width, initial-scale=1" />
        <title>Obrigado!</title>
        <link href='https://fonts.googleapis.com/css?family=Lato:300,400|Montserrat:700' rel='stylesheet' type='text/css' />
        <style jsx> {`

            @font-face {
                font-family: "Akkurat-Regular";
                src:url("../font/akkurat/lineto-akkurat-regular.eot");
                src:url("../font/akkurat/lineto-akkurat-regular.eot?#iefix") format("embedded-opentype"),
                    url("../font/akkurat/lineto-akkurat-regular.woff") format("woff");
                font-weight: normal;
                font-style: normal;
            }

            .cf:before,
            .cf:after {
                content: " ";
                display: table;
            }
            .cf:after {
                clear: both;
            }

            * {
                box-sizing: border-box;
            }

            html {
                font-size: 16px;
                background-color: #fffffe;
            }
            body {
                padding: 0 20px;
                min-width: 300px;
                font-family: 'Akkurat-Regular', sans-serif;
                background-color: #fffffe;
                color: #1a1a1a;
                text-align: center;
                word-wrap: break-word;
                -webkit-font-smoothing: antialiased
            }
            a:link,
            a:visited {
                color: #00c2a8;
            }
            a:hover,
            a:active {
                color: #03a994;
            }

            .site-header {
                margin: 0 auto;
                padding: 80px 0 0;
                max-width: 820px;
            }
            .site-header__title {
                margin: 0;
                font-family: Montserrat, sans-serif;
                font-size: 2.5rem;
                font-weight: 700;
                line-height: 1.1;
                text-transform: uppercase;
                -webkit-hyphens: auto;
                -moz-hyphens: auto;
                -ms-hyphens: auto;
                hyphens: auto;
            }

            .main-content {
                margin: 0 auto;
                max-width: 820px;
            }
            .main-content__checkmark {
                font-size: 4.0625rem;
                line-height: 1;
                color: #24b663;
            }
            .main-content__body {
                margin: 20px 0 0;
                font-size: 1rem;
                line-height: 1.4;
            }

            .site-footer {
                margin: 0 auto;
                padding: 80px 0 25px;
                padding: 0;
                max-width: 820px;
            }
            .site-footer__fineprint {
                font-size: 0.9375rem;
                line-height: 1.3;
                font-weight: 300;
            }

            @media only screen and (min-width: 40em) {
                .site-header {
                    padding-top: 150px;
                }
                .site-header__title {
                    font-size: 6.25rem;
                }
                .main-content__checkmark {
                    font-size: 9.75rem;
                }
                .main-content__body {
                    font-size: 1.25rem;
                }
                .site-footer {
                    padding: 145px 0 25px;
                }
                .site-footer__fineprint {
                    font-size: 1.125rem;
                }
            }
        `}

        </style>
    </Head>
    <body>
        <header class="site-header" id="header">
            <i class="fa fa-check main-content__checkmark" id="checkmark"></i>
            <h1 class="site-header__title" data-lead-id="site-header-title">Compra Efetuada!</h1>
        </header>

        <div class="main-content">
            <p class="main-content__body" data-lead-id="main-content-body">Obrigado por comprar com a gente! Agora basta entrar em contato conosco pelo whatsapp ou e-mail que vamos prosseguir com seu boost!</p>
        </div>

        <footer class="site-footer" id="footer">
            <p class="site-footer__fineprint" id="fineprint">Copyright ©2020 | All Rights Reserved</p>
        </footer>
    </body>
  </>
  );
}
